import React from 'react';
import { Statistic, Row, Col } from 'antd';
import 'antd/dist/antd.css';

class StNum extends React.Component {
    render() {
        return (
            <div>
                <Col span={12}>
                    <Statistic title="Active Users" value={112893} />
                </Col>
            </div>
        );
    }
}

export default StNum;
